import { Image, VStack } from '@chakra-ui/react'
import React from 'react'

const Card = ({amout , img ,checkoutHandler}) => {
  return (
    <VStack>
        <Image src = {img}/>
        <Text>{amout}</Text>
        <Button onClick={checkoutHandler}>Buy Now</Button>

    </VStack>
  )
}

export default Card
